//import Pion from './Pions';
import './style.css';

const Case = () => {

    const Pion = () => {

        const changeColor = (e) => {
            e.target.classList.add('styled')
        }

        return (
            <div className="pion" onClick={changeColor}></div>
        )
    }

    return (
        <div className="rondCases">
            <Pion />
        </div>
    )
}

export default Case;
